import React from "react";

const matlab_img = () => (
  <div>
    <img src="images/skills/matlab/matlab_icon.jpg" />
  </div>
);

const matlab = {
  title: "Matlab",
  icon: matlab_img,
  svg_icon: null,
  value: "50"
};

export default matlab;
